var majorityElement = function (nums) {
  const arrTime = nums.reduce((acc, val) => {
    if (acc.length === 0) {
      acc.push({ [val]: 1 })
    } else {
      const idx = acc.findIndex(e => +Object.keys(e)[0] === val)
      if (idx !== -1) {
        acc[idx][val] = acc[idx][val] + 1
      } else {
        acc.push({ [val]: 1 })
        return acc
      }
    }
    return acc
  }, [])
  arrTime.sort((a, b) => b[Object.keys(b)[0]] - a[Object.keys(a)[0]])
  const result = arrTime.filter(val => val[Object.keys(val)[0]] > nums.length / 2)

  return +Object.keys(result[0])[0]
}

